import React from "react"
import Header from "./Header"

class Home extends React.Component {



    //Handles User Log out
    handleLogOutClick = () => {
        fetch("http://localhost:3000/logout")
            .then(resp => resp.json())
            .then(data => {
                console.log(data)
                this.props.userLogout(this.props.user.user)
            })
    }

    render() {
        return (
            <div>
                <Header />
                <h1>Home</h1>
            </div>

        )
    }
}

export default Home
